using TonSdk.Core.Boc;

namespace TonSdk.Core.Tests;

public class BOCTest {
    [Test]
    public void DeserializeConfigDataTest() {
        var configData = "";
        var dataCell = Cell.From(configData);
        Assert.That(dataCell.Hash.ToString("hex"), Is.EqualTo("8BCA21F95338067CA9134CAB65EC7F507B593A872A253CA3A90F4D70934E514A"));
    }

    [Test]
    public static void SerializeTest() {
        var configData = "";
        var dataCell = Cell.From(configData);
        Assert.That(dataCell.Serialize(true).ToString(), Is.EqualTo(configData));
    }
}
